class Solution
{
#ifdef DEBUG
#define debug(x) cout<<__LINE__<<" "<<#x<<"="<<x<<endl;
#else
#define debug(x)
#endif
#define here cout<<__LINE__<< "  " << "_______________here" <<endl;
#define clr(NAME,VALUE) memset(NAME,VALUE,sizeof(NAME)) 
#define MAX 0x7fffffff 
#define MIN 0x80000000
#define N 16000010
#define PRIME 999983
public:
    int numDistinct(string S, string T) {
        int ls = S.length(), lt = T.length();
        int dp[ls][lt];
        clr(dp, 0);
        int maxn = 0;
        for (int i = 0; i < ls; i++) {
            for (int j = 0; j < lt; j++) {
                if (S[i] == T[j]) {
                    if (i - 1 < 0 && j - 1 < 0) {
                        dp[i][j] = 1;
                    } else if (i - 1 < 0 && j - 1 >= 0) {
                        dp[i][j] = 1;
                    } else if (j - 1 < 0 && i - 1 >= 0) {
                        dp[i][j] = 1;
                    } else {
                        dp[i][j] = max(dp[i][j], dp[i - 1][j - 1] + 1);
                    }
                }
                if (i - 1 < 0 && j - 1 < 0) {
                    dp[i][j] = max(1, dp[i][j]);
                    dp[i][j] = max(1, dp[i][j]);
                } else if (i - 1 < 0 && j - 1 >= 0) {
                    dp[i][j] = max(dp[i][j], dp[i][j - 1]);
                } else if (i - 1 >= 0 && j - 1 < 0) {
                    dp[i][j] = max(dp[i][j], dp[i - 1][j]);
                } else {
                    dp[i][j] = max(dp[i][j], dp[i][j - 1]);
                    dp[i][j] = max(dp[i][j], dp[i - 1][j]);
                }
                
                maxn = max(dp[i][j], maxn);
            }
        }
        if (maxn == lt) {
            return ls - lt;
        } else {
            return 0;
        }
        
    }

};

